(7, 1493489295, 3, 'updated', 'new', 5, 'a:3:{s:11:"description";a:2:{s:4:"from";s:3477:"<p style="text-align:justify">“Water and Sustainable Development” is the theme of Earth Day 2015 in Vietnam. The event was organized by Center for Environment and Community Research (CECR), Vietnam Environment Administration, US Embassy, LMNS at Thong Nhat Park in Hanoi on April 19th 2015. <a href="http://www.vietnamevents.com/events" style="border: 0px none; margin: 0px; outline: none medium; padding: 0px; text-decoration: none; line-height: 20px; color: rgb(255, 255, 255) !important;"><strong>Vietnamevents</strong> </a>(a member of Hoabinh Group) undertook logistics administration for the event.</p>\r\n\r\n<p style="text-align:justify">Earth Day (April 22nd) was first proposed in US in 1970. In 2009, the program was recognized by the United Nations and launched all over the world with the support of hundreds of millions of people from 192 countries. The purpose of Earth Day is to raise awareness and mobilize resources to protect the environment.</p>\r\n\r\n<p style="text-align:justify">In Vietnam, Earth Day has been organized annually by Vietnam Environment Administration (VEA) and Center for Environment and Community Research (CECR) since 2012. In the morning of April 19th 2015, the event was organized at Thong Nhat Park with the participation of the volunteers, companies, associations and organizations.</p>\r\n\r\n<p style="text-align:center"><em><img alt="" src="http://timnhanh360.com/source/1xiao_14.jpg" style="height:397px; width:600px" /><br />\r\nMr. Lai Thai Binh, representative from Department of American Affairs – Ministry of Foreign Affairs Vietnam, made a speech to launch Earth Day 2015</em></p>\r\n\r\n<p style="text-align:justify">Earth Day 2015 attracted the participation of about 2000 volunteers from associations (Ngoc Khanh Ward, Hoang Van Thu Ward, Quang An Ward, Kim Lien Ward, O Cho Dua Ward, Ha Dinh Ward), universities in Hanoi (Hanoi University of Natural Resources and Environment, Hanoi University of Technology, Vietnam National University of Agriculture, Academy of Policy and Development, companies and banks (Standard Chartered Vietnam, Viet A Bank, Lock&Lock)</p>\r\n\r\n<p><em><img alt="" src="http://timnhanh360.com/source/1xiao_15.jpg" style="height:397px; width:600px" /><br />\r\nThousands of students and volunteers taking part in Earth Day 2015</em></p>\r\n\r\n<p style="text-align:justify">This year’s theme is “Water and Sustainable Development” which aims to attract the participation of stakeholders in controlling and preventing water pollution, gradually changing for a better environment.</p>\r\n\r\n<p style="text-align:justify">Apart from raising awareness to protect water environment and calling for lake protection (cleaning up at Bay Mau Lake, Thien Quang Lake, riding bicycle for Hanoi lakes, delivering leaflets on environment protection); Earth Day 2015 holds a wide array of activities such as exchanging rubbish with trees and environmental-friendly products, drawing for the environment, exhibiting products and pictures.</p>\r\n\r\n<p style="text-align:justify">There are some music performances by singers Tu Nhu Tai, David Murray, Thuy Anh and a flashmob by the volunteers to urge people to stop releasing waste into water resources.</p>\r\n\r\n<p style="text-align:justify">Since the first Earth Day 2012, with the professional staffs, modern equipments and thoughtful preparation, Vietnamevents has contributed to the success of the meaningful events.</p>\r\n\r\n<p style="text-align:justify"><em>Le Xuan</em></p>\r\n";s:2:"to";s:3478:"<p style="text-align:justify">“Water and Sustainable Development” is the theme of Earth Day 2015 in Vietnam. The event was organized by Center for Environment and Community Research (CECR), Vietnam Environment Administration, US Embassy, LMNS at Thong Nhat Park in Hanoi on April 19th 2015. <a href="http://www.vietnamevents.com/events" style="border: 0px none; margin: 0px; outline: none medium; padding: 0px; text-decoration: none; line-height: 20px; color: rgb(255, 255, 255) !important;"><strong>Vietnamevents</strong> </a>(a member of Hoabinh Group) undertook logistics administration for the event.</p>\r\n\r\n<p style="text-align:justify">Earth Day (April 22nd) was first proposed in US in 1970. In 2009, the program was recognized by the United Nations and launched all over the world with the support of hundreds of millions of people from 192 countries. The purpose of Earth Day is to raise awareness and mobilize resources to protect the environment.</p>\r\n\r\n<p style="text-align:justify">In Vietnam, Earth Day has been organized annually by Vietnam Environment Administration (VEA) and Center for Environment and Community Research (CECR) since 2012. In the morning of April 19th 2015, the event was organized at Thong Nhat Park with the participation of the volunteers, companies, associations and organizations.</p>\r\n\r\n<p style="text-align:center"><em><img alt="" src="http://timnhanh360.com/source/1xiao_14.jpg" style="height:397px; width:600px" /><br />\r\nMr. Lai Thai Binh, representative from Department of American Affairs – Ministry of Foreign Affairs Vietnam, made a speech to launch Earth Day 2015</em></p>\r\n\r\n<p style="text-align:justify">Earth Day 2015 attracted the participation of about 2000 volunteers from associations (Ngoc Khanh Ward, Hoang Van Thu Ward, Quang An Ward, Kim Lien Ward, O Cho Dua Ward, Ha Dinh Ward), universities in Hanoi (Hanoi University of Natural Resources and Environment, Hanoi University of Technology, Vietnam National University of Agriculture, Academy of Policy and Development, companies and banks (Standard Chartered Vietnam, Viet A Bank, Lock&Lock)</p>\r\n\r\n<p><em><img alt="" src="http://timnhanh360.com/source/1xiao_15.jpg" style="height:397px; width:600px" /><br />\r\nThousands of students and volunteers taking part in Earth Day 2015</em></p>\r\n\r\n<p style="text-align:justify">This year’s theme is “Water and Sustainable Development” which aims to attract the participation of stakeholders in controlling and preventing water pollution, gradually changing for a better environment.</p>\r\n\r\n<p style="text-align:justify">Apart from raising awareness to protect water environment and calling for lake protection (cleaning up at Bay Mau Lake, Thien Quang Lake, riding bicycle for Hanoi lakes, delivering leaflets on environment protection); Earth Day 2015 holds a wide array of activities such as exchanging rubbish with trees and environmental-friendly products, drawing for the environment, exhibiting products and pictures.</p>\r\n\r\n<p style="text-align:justify">There are some music performances by singers Tu Nhu Tai, David Murray, Thuy Anh and a flashmob by the volunteers to urge people to stop releasing waste into water resources.</p>\r\n\r\n<p style="text-align:justify">Since the first Earth Day 2012, with the professional staffs, modern equipments and thoughtful preparation, Vietnamevents has contributed to the success of the meaningful events.</p>\r\n\r\n<p style="text-align:justify"><em>Le Xuans</em></p>\r\n";}s:16:"shortDescription";a:2:{s:4:"from";s:356:"“Water and Sustainable Development” is the theme of Earth Day 2015 in Vietnam. The event was organized by Center for Environment and Community Research (CECR), Vietnam Environment Administration, US Embassy, LMNS at Thong Nhat Park in Hanoi on April 19th 2015. Vietnamevents (a member of Hoabinh Group) undertook logistics administration for the event.";s:2:"to";s:359:"“Water and Sustainable Development” is the theme of Earth Day 2015 in Vietnam. The event was organized by Center for Environment and Community Research (CECR), Vietnam Environment Administration, US Embassy, LMNS at Thong Nhat Park in Hanoi on April 19th 2015. Vietnamevents (a member of Hoabinh Group) undertook logistics administration for the event. a4";}s:11:"last_update";a:2:{s:4:"from";s:10:"1493488023";s:2:"to";i:1493489295;}}', 0),
