(192, 1509332742, 32, 'updated', 'new', 151, 'a:5:{s:11:"description";a:2:{s:4:"from";s:0:"";s:2:"to";s:0:"";}s:16:"shortDescription";a:2:{s:4:"from";s:684:"Được đánh giá là đất nước văn minh và sạch sẽ bậc nhất châu Á, ở Singapore, ra đường khó để tìm một cọng rác hay thùng rác, mọi người xếp hàng chờ tàu 1 cách có trật tự, đi tàu điện thì luôn chủ động nhường ghế cho người già, trẻ em, phụ nữ có thai… xe hơi sẽ dừng lại nhường cho bạn khi có ý định qua đường (tại nơi được phép nhé), hay khi đi thang cuốn tất cả sẽ luôn đứng sát về 1 bên trái, để ai có việc gấp sẽ vượt lên đi trước phía bên phải…một đất nước mà đôi khi không cần quá nhiều tiền mặt,";s:2:"to";s:235:"Nếu bạn chưa đi du lịch nước ngoài nhiều, thì lời khuyên cho bạn là nên ghé thăm Singapore ít nhất 1 lần. Và trước tiên, hãy cùng nhau tìm hiểu những điểm đến hấp dẫn nhất Singapore.";}s:4:"date";a:2:{s:4:"from";s:10:"1509332189";s:2:"to";i:1509296400;}s:11:"last_update";a:2:{s:4:"from";s:1:"0";s:2:"to";i:1509332741;}s:13:"author_update";a:2:{s:4:"from";s:1:"0";s:2:"to";s:2:"32";}}', 0),
