INSERT INTO `options` (`id`, `option_key`, `option_value`) VALUES
(1, 'title', 'Công ty du lịch Hòa Bình Tourist'),
(2, 'keywords', 'Công ty du lịch Hòa Bình Tourist, du lịch Hòa Bình '),
(3, 'descriptions', 'Công ty du lịch Hòa Bình Tourist chuyên tổ chức tour du lịch, dịch vụ đặt phòng khách sạn, vé máy bay'),
(4, 'contact1', '<p>lien he 1</p>\r\n'),
(5, 'contact2', '<p>lien he 2</p>\r\n'),
(6, 'cskh', '0913.006.346 - 024.3732.5976 (325)'),
(7, 'hotline_footer_main', '0913.311.911'),
(8, 'menu_footer_1', 'null'),
(9, 'post_rule', '<p style="text-align:justify"><strong>Điều kiện thanh toán:</strong></p>\r\n\r\n<p style="text-align:justify">- Khách đặt cọc 50% giá trị tour ngay khi đăng kí</p>\r\n\r\n<p style="text-align:justify">- Khách thanh toán nốt so tiền còn lại trước khi khởi hành 10 ngày.</p>\r\n\r\n<p style="text-align:justify"><strong>Các điều kiện khi đăng ký tour:</strong></p>\r\n\r\n<p>Sau khi đăng ký tour, mọi trường hợp khách báo hoãn hủy sẽ phải chịu chi phí phạt hủy như sau:<br />\r\n- Ngay sau khi đăng ký tour số tiền phạt là: 30% giá tour, nhân với số lượng khách hủy.<br />\r\n- Từ 15 - 30 ngày trước ngày khởi hành số tiền phạt là: 50% giá tour , nhân với số lượng khách hủy.<br />\r\n- Từ 05 - 09 ngày trước ngày khởi hành số tiền phạt là: 80% giá tour, nhân với số lượng khách hủy.<br />\r\n- Hoãn/ hủy trong 04 ngày khởi hành không được hoàn lại số tiền đã nộp. Bên A tự ý bỏ chương trình không thông báo trước sẽ không được hoàn trả bất kỳ phí nào. Trong trường hợp đoàn không thể khởi hành theo dự kiến do các nguyên nhân bất khả kháng như thiên tai, bão lụt, chiến tranh, hủy hoãn bay do hãng hàng không... Bên B sẽ thu xếp ngày khởi hành mới. Mọi chi phí phát sinh do hai bên thỏa thuận. Bên B có trách nhiệm tư vấn cho bên A xử lý các vẫn đề phát sinh nếu có trong quá trình thực hiện chuyến đi. Bên B phải thực hiện đúng đủ chương trình với chất lượng và giá cả theo chương trình đính kèm. </p>\r\n\r\n<p><span style="color:#FF0000"><strong>Lưu ý: Đối với tour quốc tế do tính chất đoàn lẻ bên B có trách nhiệm gom khách đủ đoàn (15 khách trở lên) sẽ khởi hành theo đúng lịch trình. Nếu số lượng có từ 10 - 14 khách, đoàn khởi hành không có hướng dẫn viên từ Việt Nam.</strong></span></p>\r\n'),
(10, 'title_default_category', 'Tour {title_default_category} - Danh sách tour {title_default_category} hấp dẫn tại Hòa Bình Tourist'),
(11, 'keyword_default_category', '{keyword_default_category}, Tour {keyword_default_category}, Tour {keyword_default_category} giá rẻ'),
(12, 'description_default_category', 'List Tour {description_default_category}hấp dẫn cho bạn. Với đội ngũ nhân viên nhiều kinh nghiệm Hòa Bình cam kết giá, chất lượng tour {description_default_category} sẽ luôn luôn cạnh tranh nhất trên thị trường hiện nay'),
(13, 'post_rule_en', '<p><strong>Payment terms:</strong><br />\r\n- When booking, you are required a 50% deposit.<br />\r\n- The remaining money will be paid 7-10 days (normal day tours), or 20-25 days (public holiday tours) before departure time.<br />\r\n<strong>Conditions for tour registration:</strong><br />\r\n- When you register your tour, please bring original ID/Passport or provide full name written on ID/Passport/Birth certificate (children under 14) in order: First/Middle/Last Name. You are required to provide name on ID documents to register, and bring those documents to travel as prescribed by the airline.<br />\r\n- The ID documents must meet all of the following requirements: For Vietnamese citizens: Children aged 14 above and adults need bring valid original ID/Passport, clear photograph (valid ID card not over 15 years, clear photograph)/original Birth certificate (childrend aged under 14), children aged 14 above have to have ID or Passport to check-in. For Foreigners/overseas Vietnamese: you have to bring valid original Passport or Green Card attached Visa, do check-in procedures according to aviation regulations.<br />\r\n- In case, you provide the wrong name, arrive late for flight, please change the ticket or buy a new ticket according to the airline regulations (if the flight still has seat available).<br />\r\n- In case, you fly by Vietjet and Jetstar, no refund, no change, cancellation, wrong name, 100% loss according to airline regulations. Airfares for children are equal to adult.<br />\r\n- In case, you flight Vietnam Airlines, no refund, no change, cancellation, wrong name, 100% loss according to airline regulations. For round trip ticket, automatically cancellation if you do not fly one way. Airfare for children equals 75% of adult tickets. <br />\r\n- Because flights depend on airlines (Vietnam Airlines, Vietjet, Jetstar,..), so in some cases, fares, flights and flight times can change without prior notice. Depending on the actual situations, the program and the tourist attractions may be flexible to change the order in which the conditions match the actual flight and weather conditions.<br />\r\nHoabinhtourist will not be held responsible for ensuring the attractions in cases:<br />\r\n+ Natural disasters: floods, droughts, earthquakes...<br />\r\n+ Security problems: terrorism, demonstration<br />\r\n+ Aviation issues: technical malfunction, security, cancellation, delay flight.<br />\r\nIf the above cases occur, Hoabinhtourist will consider to refund visitors expenses as much as possible (after deducting the services performed... and not be responsible to indemnify for any additional costs).<br />\r\n- After you have completed the check-in and receive the boarding pass, please keep carefully and note to get on the plane on time. Hoabinhtourist is not responsible for any loss of boarding pass and late the boarding time according to the airline regulations.<br />\r\n- Check-in & check-out time is in accordance with hotel policy, after 14:00 PM and before 12:00 AM.<br />\r\n- Hotel/resort rooms cannot be close, on the same floor, single bed room or twin bed room depending on the actual situation of each hotel/resort.<br />\r\n- For tours using 5 star hotel/resort service: Vietnamese cetizens stay in same room with foreigner, required marriage certificate.<br />\r\n- If you is solo traveller, it is compulsory to pay extra to staying alone in one room. In case, there are also solo travellers in group, same sex and want to pair in same room, Hoabinhtourist will refund extra money for you.<br />\r\n- If you travel in the group of 3, Hoabinhtourist will provide 01 room for 03 guests, 01 big bed 1m6 and 1 extra mobile bed 0.8 - 1.2m or 01 single mattress depending on the hotel/resort. In case, you want to stay separately, please pay extra in accordance with the regulations.<br />\r\n- Baggage information when traveling: Hand luggage: under 7kg/1person - size: 56cm x 36cm x 23 cm, liquid with volume not more than 100ml. Checked baggage: 20kg/1person - size: 119cm x 119cm x 81cm. Items not accepted as checked luggage or transported in baggage in accordance with the airport regulations.<br />\r\n- Pick-up information: At Tan Son Nhat airport, national train station, 2 hours (normal days), 2 hours 30 minutes (public holidays) before flight time.<br />\r\n- Tourists aged under 18 years old travelling have to be acompanied by parents or relatives aged over 18 years old. In case of travelling alone, parents have to authorized to Hoabinhtourist (certified by local authority)<br />\r\n- For the health reasons, safety as well as to ensure the best experience, you need to be healthy to join our tour. Women aged 55 and older and male aged 60 and older should be accompanied by a relative under 55 years of age (in full health). For tourists aged 70 and above: A relative under the age of 55 (in full health) is required to accompany and submit a medical certificate, certified by doctor for travel + health paper according to the form prescribed by the company. We limited and do not accept tourists aged over 80 years old and tourists aged 80, who do not have insurance.<br />\r\n- Pregnant traveller: please inform the staff at the time of booking. You need get doctor approval before touring. You have to commit to take self-responsibility for your health and the baby during your participation in the tour. When you are on the tour, bring the pregnancy medical record book and personal papers.<br />\r\n- For island tours: If you are unwell, have a history of illness or have alcoholic drink (alcohol, beer...), you should not bathe & dive to ensure safety. Any things happened, Hoabinhtourist will not take any responsible.<br />\r\n- If you need to have invoice, please provide invoice information to staff during registration. We does not issue invoice after the tour ended.<br />\r\n- Please carefully check the conditions of the ticket before booking tour. In case of non-direct registration, please ask your family member to update the information from the register.<br />\r\nNotices: In case of tour transfer/cancellation:<br />\r\n- After payment, if you want to transfer/cancel tour, please bring Travel Ticket to the tour booking office to complete the transfer/cancellation procedures and pay a fee in accordance with the provisions of Hoabinhtourist. We do not solve cases that contact to transfer/cancel tour by phone.<br />\r\n- In case, you choose the tour using promo flight tickets, non-refundable tickets, unchange tickets, if you cancel tour, you lose fees based on the requirements of the airlines.<br />\r\nCancellation conditions: (in normal days) <br />\r\n- The Client can change the booked tour to other tours for free change fee before 5 days prior to departure date. <br />\r\n- Change to other tours after confirmation to 5 days prior to departure date, the Client will be fined 10% on travel fares.<br />\r\n- Cancellation right after confirmation, the Client will be fined 20% on travel fares.<br />\r\n- Cancellation after confirmation to 5 days prior to departure date, the Client will be fined 30% on travel fares.<br />\r\n- Cancellation after confirmation to 3-5 days prior to departure date, the Client will be fined 50% on travel fares.<br />\r\n- Cancellation after confirmation to 2 days prior to departure date, the Client will be fined 60% on travel fares.<br />\r\n- Cancellation after confirmation within 24 hours prior to departure date, the Client will be fined 80% on travel fares.<br />\r\n- Cancellation without prior notice or arrive late after departure time, the Client will be fined 100% on travel fares.<br />\r\n- Cancellation of airplane/train services, the Client must follow terms and conditions of airline companies/train operators<br />\r\nCancellation conditions: (in public holidays)<br />\r\n- The Client can change the booked tour to other tours for free change fee before 10 days prior to departure. <br />\r\n- Change to other tours after confirmation to 10 days prior to departure date, the Client will be fined 10% on travel fares.<br />\r\n- Cancellation right after confirmation, the Client will be fined 20% on travel fares.<br />\r\n- Cancellation after confirmation to 10 days prior to departure date, the Client will be fined 30% on travel fares.<br />\r\n- Cancellation after confirmation to 07-10 days prior to departure date, the Client will be fined 50% on travel fares.<br />\r\n- Cancellation after confirmation to 04-07 days prior to departure date, the Client will be fined 60% on travel fares.<br />\r\n- Cancellation after confirmation to 2 days prior to departure date, the Client will be fined 80% on travel fares.<br />\r\n- Cancellation without prior notice or arrive late after departure time, the Client will be fined 100% on travel fares.<br />\r\n- Cancellation of airplane/train services, the Client must follow terms and conditions of airline companies/train operators.<br />\r\n+ The public holidays tours are operated in the public holiday dates<br />\r\n+ Cancellation time is calculated for working days, excluding Saturdays, Sundays and public holidays.<br />\r\n+ Cancellation of trip must be notified directly to Hoabinhtourist by Email or fax and must be confirmed by Hoabinhtourist.<br />\r\nForce majeure:<br />\r\nIf the travel program is canceled or changed by either party for a force majeure reason (fire, weather, accident, natural disaster, war ...), neither party shall be held responsible to indemnify the damage happened and any legal responsible. However, each party is obliged to make every efforts to help the injured party to minimize the loss caused by force majeure.</p>\r\n\r\n<p> </p>\r\n');
