(51, 'welcome_our_group', 'Với mục tiêu mang đến chất lượng qua từng dịch vụ. Chúng tôi luôn cung cấp tới quý khách hàng những gói dịch vụ chất lượng cao nhất với mức giá không thể tốt hơn. Ngoài ra để đáp ứng nhu cầu ngày càng lớn từ phía khách hàng, chúng tôi muốn đem lại cho những khách hàng thân thiết những ưu đãi hoàn hảo riêng, từ đó tăng sự hài lòng khi sử dụng dịch vụ. Rồi chúng tôi quan niệm - sự hài lòng của quý khách là thành công lớn của chúng tôi. %s Dưới đây là các quyền lợi của quý khách hàng khi đăng ký tài khoản trên Hoabinhtourist', 'With the goal of bringing quality through each service. We always provide our customers with the highest quality service packages at the best price. In addition, in order to satisfying the growing demand from customers, we want to give our loyal customers the perfect incentive, which increases the satisfaction when using the service. Then we conceive - your satisfaction is our great success. %s Here are the benefits of becoming a member of Hoabinhtourist.'),
